import React, { useEffect } from 'react'
import { useState } from 'react'
function List({ Employees,Isadding }) {


  return (
    <div>
      <button onClick={()=> Isadding(true)} className='btn btn-primary mt-3'>Add Employee</button>
      {Employees.map((employee) => {
        return (
          <div>
                  <section className='container'>
                      <div className='row'>
                                <div className='col-lg-6'>
                               {employee.id}  {employee.Name} {employee.Email} {employee.Pnumber} {employee.Date}

                                </div>
                      </div>


                  </section>

          </div>
        )
      })}

    </div>
  )

}

export default List
